                padding: 46px;
                -webkit-box-shadow: 0px 7px 20px 5px rgba(118,122,128,0.25);
                -moz-box-shadow: 0px 7px 20px 5px rgba(118,122,128,0.25);
                box-shadow: 0px 7px 20px 5px rgba(118,122,128,0.25);

                h4 {
                    font-size: 1.3rem;
                    margin-bottom: 4rem;
                    margin-top: 2rem;
                }

                input[type="text"], input[type="email"], textarea {
                    width: 100%;
                    background: transparent;
                    border: none;
                    border-bottom: 2px solid $color5;
                    margin-bottom: 2rem;
                    font-size: 0.8rem;
                    text-transform: uppercase;
                    line-height: 1.2;
                    color: $color5;
                    padding: 15px 0;
                }

                button[type="submit"] {
                    background: $color1;
                    border: none;
                    -webkit-border-radius: 30px;
                    -moz-border-radius: 30px;
                    border-radius: 30px;    
                    text-align: center;
                    color: $color3;
                    padding: 17px 30px;
                    text-transform: uppercase;
                    width: 100%;
                    font-size: 1rem;
                }
            }
        }

        .contact-section {
            vertical-align: top;
            display: inline-block;;
            padding: 56px 0 0 0;
            width: 70%;
            float: left;

            .contact-info {
                h1 {
                    font-size: 2.3rem;
                    font-weight: 500;
                    line-height: 1.2;
                    margin: 0 0 1rem;
                    span {
                        color: $color1;
                    }
                }
            }

            .contact-box {
                width: 100%;
                padding: 30px;
                transition: all .3s ease-in-out;
                cursor: pointer;
                max-width: 600px;

                &:hover {
                    -webkit-box-shadow: 0px 7px 20px 5px rgba(118,122,128,0.10);
                    -moz-box-shadow: 0px 7px 20px 5px rgba(118,122,128,0.10);
                    box-shadow: 0px 7px 20px 5px rgba(118,122,128,0.10);
                }

                h5 {
                    font-weight: 500;
                    font-size: 1.3rem;
                    margin-bottom: 1.4rem;
                }
                p {
                    font-weight: 300;
                    font-size: 1rem;
                    margin-bottom: 1rem;
                }
            }

        }
    }
}


